  function parseKeyValue(tag, name, options) {
    let count = options.counter++,
    expr = `!doNotWrap ? exprs[${count}]() : exprs[${count}]`;
    if (name === "style") {
      options.exprs.push(`r.style(${tag}, ${expr})`);
    } else if (name === "classList") {
      options.exprs.push(`r.classList(${tag}, ${expr})`);
