      value = node.attrs[name];

      if (value === "###") {
        dynamicKeys.push(`"${name}"`);
        let count = options.counter++;
        props.push(
        `${name}: typeof exprs[${count}] === "function" ? exprs[${count}] : () => exprs[${count}]`);

      } else props.push(`${name}: "${value}"`);
